I have always considered myself merely a vehicle or a medium to tell stories that hopefully will affect positive social change. I was thrilled with how audiences reacted to the strong message about gender inclusivity that #ShubhMangalZyadaSaavdhan (SMZS) delivered, making it a unique success story.

On the second anniversary of the film, I again want to highlight that what’s most important right now is representation of the community in mainstream cinema. 

I think awareness among our countrymen has been created by films like Shubh Mangal Zyada Saavdhan, Chandigarh Kare Aashiqui and now Badhaai Do. I believe we are moving in the right direction. SMZS and CKA will be remembered as baby steps towards a bigger impact.

